import SimpleForm from './components/SimpleForm';
import { ThemeProvider } from 'styled-components';
import './index.css';



class App extends Component {
  render() {
    return (

      <ThemeProvider theme={theme}>
        <SimpleForm steps={steps} />
      </ThemeProvider>


    );
    }  
}

export default App;
